namespace RonSijm.FluidHumidifier.Factories.Glue;

public class ClassifierFactory(string resourceName = null, Action<Humidifier.Glue.Classifier> factoryAction = null) : ResourceFactory<Humidifier.Glue.Classifier>(resourceName)
{

    internal InnerClassifierXMLClassifierFactory XMLClassifierFactory { get; set; }

    internal InnerClassifierJsonClassifierFactory JsonClassifierFactory { get; set; }

    internal InnerClassifierCsvClassifierFactory CsvClassifierFactory { get; set; }

    internal InnerClassifierGrokClassifierFactory GrokClassifierFactory { get; set; }

    protected override Humidifier.Glue.Classifier Create()
    {
        var classifierResult = CreateClassifier();
        factoryAction?.Invoke(classifierResult);

        return classifierResult;
    }

    private Humidifier.Glue.Classifier CreateClassifier()
    {
        var classifierResult = new Humidifier.Glue.Classifier
        {
            GivenName = InputResourceName,
        };

        return classifierResult;
    }
    public override void CreateChildren(Humidifier.Glue.Classifier result)
    {
        base.CreateChildren(result);

        result.XMLClassifier ??= XMLClassifierFactory?.Build();
        result.JsonClassifier ??= JsonClassifierFactory?.Build();
        result.CsvClassifier ??= CsvClassifierFactory?.Build();
        result.GrokClassifier ??= GrokClassifierFactory?.Build();
    }

} // End Of Class

